/**
 * @param {string} str1
 * @param {string} str2
 * @return {string}
 */
var gcdOfStrings = function(str1, str2) {
    if (judgeGcdStr(str1) == judgeGcdStr(str2)) {
        return judgeGcdStr(str1);
    } else {
        return '';
    }
    

};

let judgeGcdStr = function(str) {
    for (let index = 1; index < str.length+1; index++) {
        const element = str.substr(0, index);
        
        if (judgeGcdString(str, element)) {
            return element;
        }
    }

    return '';

}

let judgeGcdString = function(str1, str2) {
    for (const iterator of str1.split(str2)) {
        if (iterator != '') {
            return false;
        }
    }
    return true;
}

